import React, { Component } from "react";
class Cart extends Component {
    constructor(props) {
        super(props);
        this.state = {
            ele: [
                {
                    e: "<span>1</span>"
                },
                {
                    e: "<span>2</span>"
                },
                {
                    e: "<span>3</span>"
                },
                {
                    e: "<span>4</span>"
                },
                {
                    e: "<span>5</span>"
                },
            ]
        };
    }
    render() {
        return (
            <div className="cart">
                我是cart组件
            </div>
        );
    }
}

export default Cart;
